sys_hub_input_scripts.script:
{"multipart_sources_string":{"scriptActive":true,"script":"/*
**Access Flow/Action data using the fd_data object. Script must return a value. 
**Order number is offset by +1 in Error Handling Section.
**Available options display upon pressing "." after fd_data
**example: var shortDesc = fd_data.trigger.current.short_description;
**return shortDesc;
*/
var mu = new global.RestStepMultipartUtil();
mu.addTextPart('select', 'true', 'text/plain');
mu.addTextPart('print', 'true', 'text/plain');
mu.addFilePart('file', fd_data._2__copy_attachment_to_task.attachment_sysid, 'application/octet-stream', fd_data._1__formulate_file_name.file_name);
return mu.build();"}}

sys_variable_value.value:
(function execute(inputs, outputs) {
  var grAtt = new GlideRecord('sys_attachment');
  var port = gs.getProperty("x_258747_octoprint.default_octoprint_port");
  if(inputs.printer_port)
  {
    port = inputs.printer_port;
  }
  if(grAtt.get(inputs.attachment)){
  
if(inputs.task)
{
  outputs.file_name = inputs.task.number + "_" + grAtt.file_name.replace(" ","_");
}else
{
  outputs.file_name = grAtt.file_name;
} 
  }
  outputs.original_file_name = grAtt.file_name;
  outputs.default_port = port;
  outputs.attachment_id = inputs.attachment;
})(inputs, outputs);

