sys_variable_value.value:
(function execute(inputs, outputs) {
  // Copy attachments (OOB Function copies all attachments)
  var attachment = new GlideSysAttachment();

  //var atts = GlideSysAttachment.copy("ZZ_YYx_258747_octoprint_3d_print_model", inputs.model.sys_id, table, tableSysId);
  var grAtt = new GlideRecord('sys_attachment');
  grAtt.get(inputs.model_attachment);
  var content = attachment.getContent(grAtt);
  var att = attachment.write(inputs.task, inputs.new_file_name, 'application/octet-stream', content);

  outputs.attachment_sysid = att;//[0].toString().split(',')[0];
})(inputs, outputs);

